INSERT INTO `rk_tel_corpus` VALUES (16230,0,0,11316,'喂，您好！',NULL),(16231,0,0,11317,'您好，我这边是百度爱采购的，是百度自己的B2B电商平台，今天给您来电，我们公司正在做入驻平台送运营的优惠活动，您这边可有兴趣了解下？',NULL),(16232,0,0,11318,'您好，我这边是百度爱采购的，是百度自己的B2B电商平台，今天给您来电，我们公司正在做入驻平台送运营的优惠活动，您这边可有兴趣了解下？',NULL),(16233,0,0,11319,'您可以稍微了解一下的，我们公司这次活动力度还是比较大的！',NULL),(16234,0,0,11320,'现在入驻百度爱采购可以赠送半年的运营，而且还送价值1000元的百度首页企业名片的',NULL),(17736,561,0,12034,'你好！我是咱们园梅会计公司的，专业做记账、报税方面的的业务，想问题一下咱们有财务会计这方面的需要吗？','/uploads/audio/20190911/201902221605335c6fad4db1479.wav'),(17737,561,0,12035,'哦，是这样的，我们公司就是专门做代理记账、申报纳税和营业执照办理，还有一些相关许可证办些这些业务，特种作业操作证之类的我们也都做的。','/uploads/audio/20190911/201902221609375c6fae414e93c.wav'),(17738,561,0,12036,'我们代记账小规模一年2000-3000元不等，一般纳税人每月500元起，所有财务上的事情全部帮你做好。','/uploads/audio/20190911/201902221610015c6fae596802f.wav'),(17739,561,0,12037,'我们特种作证也可以办理，像电焊证、电工证、叉车证证之类的，你要有朋友需要也可以联系我们。','/uploads/audio/20190911/201902221610235c6fae6f87752.wav'),(17740,561,0,12038,'咱们公司在亳州市谯城区建安路与杜仲路交口翰林华府，就是在万达广场东边一点，有时间我可以过去咱见当面聊一下。','/uploads/audio/20190911/201902221611585c6faece18830.wav'),(17741,561,0,12039,'那咱们公司是在什么地方？有时间我可以过去咱们当面谈一下。','/uploads/audio/20190911/201902221612205c6faee4775fe.wav'),(17742,561,0,12040,'那我一会加一下你的微信，价格之类的回头发你微信上！','/uploads/audio/20190911/201902221612385c6faef6ae640.wav'),(17743,561,0,12041,'现在在亳州地区和我们合作的企业有上百家，因为我们价格还是比较优惠的，我建议您可以再考虑一下。我们业务范围也比较全面。','/uploads/audio/20190911/201902221613015c6faf0da916e.wav'),(17744,561,0,12042,'为什么不考虑一下跟我们合作呢，我们公司的会计都是经验比较丰富的，在财务和处理税务问题上，有很丰富的处理经验，我觉得在合作后在很多问题上都可以帮到您的。','/uploads/audio/20190911/201902221613185c6faf1e9ec58.wav'),(17745,561,0,12043,'那打扰您了，祝您生活愉快，再见！','/uploads/audio/20190911/201902221613375c6faf314f600.wav'),(17746,561,0,12044,'',''),(17747,561,0,12045,'',''),(17748,561,0,12046,'',''),(17749,561,0,12047,'',''),(17750,561,0,12048,'',''),(17751,561,0,12049,'',''),(17752,561,0,12050,'',''),(17753,561,0,12051,'',''),(17754,561,0,12052,'',''),(17755,561,0,12053,'',''),(17756,561,0,12054,'',''),(17757,561,0,12055,'',''),(17758,561,0,12056,'',''),(17759,561,0,12057,'',''),(17760,561,0,12058,'',''),(17761,561,0,12059,'',''),(17762,561,0,12060,'',''),(17763,561,0,12061,'',''),(17764,561,0,12062,'',''),(17765,561,0,12063,'',''),(17766,561,1,12370,'呵呵，我们女孩子的年龄是不能随便透露的','/uploads/audio/20190911/20190220042044.wav'),(17767,561,1,12371,'好的，打扰了，等您忙完了我再联系您','/uploads/audio/20190911/20190220042225.wav'),(17768,561,1,12372,'哦，我叫吴园梅，口天吴，你可以叫我小吴。','/uploads/audio/20190911/20190220042245.wav'),(17769,561,1,12373,'那打扰您了，祝您生活愉快，再见！','/uploads/audio/20190911/20190220042303.wav'),(17770,561,1,12374,'哦，不好意思，您请讲！',''),(17771,561,1,12375,'哦，好的','/uploads/audio/20190911/20190220042517.wav'),(17772,561,1,12376,'喂，能听到吗？',''),(17773,561,1,12377,'我觉得这些问题，还是让我们专业的会计人员为你解答会更好点。要不你稍等一下，我让会计师和你联系一下','/uploads/audio/20190911/20190220042927.wav'),(17774,561,1,12378,'那打扰您了，祝您生活愉快，再见！','/uploads/audio/20190911/20190220043008.wav'),(17775,561,1,12379,'那等您方便的时候我们再联系，祝您生活愉快，再见！','/uploads/audio/20190911/20190220043037.wav'),(17776,561,1,12380,'我们是亳州市园梅会计公司，花园的园，梅花的梅。','/uploads/audio/20190911/20190220043104.wav'),(17777,561,1,12381,'哦，那不好意思，那您注意安全，我回头再和你联系！','/uploads/audio/20190911/20190220043120.wav'),(17778,561,1,12382,'有的，这样，稍后让我们专业的会计跟您联系，跟您具体说一下个体户、小规模和一般纳税人之间各自的优势','/uploads/audio/20190911/20190220043142.wav'),(17779,561,1,12383,'哦，没关系，以后咱们公司再经营的时候需要这方面的服务可以和我们联系。','/uploads/audio/20190911/20190220043208.wav'),(17780,561,1,12384,'您是营业执照注销了还是准备注销？','/uploads/audio/20190911/20190220043433.wav'),(17781,561,1,12385,'这个需要的资料比较多，我一会加你微信，把需要的资料发你手机上就行了。','/uploads/audio/20190911/20190220043637.wav'),(17782,561,1,12386,'哦，这那个没关系的，你可以对比一下价格，我们的价格在同行业中相对来说还是比较优惠的，许可证，建筑资质理，商标，各类特种作业操作证之类的我们也都做的。以后有其它的我们也可以合作的。','/uploads/audio/20190911/20190220043702.wav'),(17783,561,1,12387,'我们公司在亳州市谯城区建安路与杜仲路交口翰林华府，就是康美中药城东门向北两个红路灯路口，你来的时候要找不到给我打电话，我一会地址发你手机上','/uploads/audio/20190911/20190220043745.wav'),(17784,561,1,12388,'我们办营业执照是600，企业记账从200-500元一个月价格都不等，具体的等会我让我们专业的会计和你联系一下。','/uploads/audio/20190911/20190220043838.wav'),(17785,561,1,12389,'银行基本户是要开的，不然您公司就不能去国地税备案，也就不能开发票，这个也简单，我们都可以全程帮你办理的。','/uploads/audio/20190911/20190220043906.wav'),(17786,561,1,12390,'是这样的，公章、财务章、法人章，都是在公安局备案的芯片章，您可以自己去刻，因为现在刻公章都要法人本人去拍照的。','/uploads/audio/20190911/20190220043940.wav'),(17787,561,1,12391,'三证合一必须做的，我们都可以包办，价格方面稍后让我们专业会计给您来电','/uploads/audio/20190911/20190220043955.wav'),(17788,561,1,12392,'这些业务我们都可以做的，具体价格一会咱们加微信后我把具体价格和需要资料发给你。','/uploads/audio/20190911/20190220044026.wav'),(17789,561,1,12393,'那没事，以后咱们如果办理税务方面的问题，有不懂的你可以随时咨询的。','/uploads/audio/20190911/20190220044053.wav'),(17790,561,1,12394,'呵呵，假证我们是不办理的，这个是违法的，我们做不了这个。','/uploads/audio/20190911/20190220044914.wav'),(17791,561,1,12395,'我们营业执照办理是600块钱帮你办好，不含公章，公章你可以自己去刻，因为现在刻公章要法人本人去拍照。','/uploads/audio/20190911/20190220044155.wav'),(17792,561,1,12396,'那行，一会我给您发个短信，加您微信，有任何财税方面的问题，您也可以直接联系我','/uploads/audio/20190911/20190220044220.wav'),(17793,561,1,12397,'不好意思啊，您问的这个问题我还没有遇到过，我先确认一下，稍后让我们专业的会计给您回电话','/uploads/audio/20190911/20190220044253.wav'),(17794,561,1,12398,'我们商标注册是1000块钱，其它就没任何费用了。','/uploads/audio/20190911/20190220044317.wav'),(17795,561,1,12399,'价格市场上肯定有高有低，这样，您看您这边什么时候有时间价格我们当面谈一下。','/uploads/audio/20190911/20190220044335.wav'),(17796,561,1,12400,'哦，这样的，号码是我们网上搜的，就是从百度上找的，也是想和咱们公司建立一个合作的机会的，所以就联系您了。',''),(17797,561,1,12401,'我们小规模200块钱一个月，一般纳税人500块钱一个月，主要看咱们具体是做什么行业和业务量而定','/uploads/audio/20190911/20190220044938.wav'),(17798,561,1,12402,'我们0申报2000块钱一年，我不建议您0申报，一直0申报会增加您公司被税务局稽查的风险，而且您前期如果没有太大的业务量，我建议您做亏损，也不要做0申报。亏损后期能抵扣企业所得税','/uploads/audio/20190911/20190220045000.wav'),(17799,561,1,12403,'我们就是专业为咱们企业代理记账报税服务的，所有财务问题和税务问题我们都可以帮咱们解决。','/uploads/audio/20190911/20190220045109.wav'),(17800,561,1,12404,'这个没关系，请问一下咱们公司是做什么行业的？','/uploads/audio/20190911/20190220045133.wav'),(17801,561,1,12405,'我们的价格也不高，服务方便您尽管放心。',''),(17802,561,1,12406,'您好，我是亳州市园梅财务会计公司的。我们是专业记账、报税、代办证件的。','/uploads/audio/20190911/20190220045312.wav'),(17803,561,1,12407,'哦，这样啊，打扰您了。好巧啊，电话打给你了。有什么问题您就随时跟我们公司联系哦。我们会尽心帮您解决',''),(17804,561,0,12064,'您好',NULL);
