CREATE TABLE `rk_tel_knowledge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `scenarios_id` int(11) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `type` tinyint(2) DEFAULT '0' COMMENT '0 普通 1业务问题 2肯定3 否定 4拒绝 5中性  6 未识别 7重复 8用户未说话 9无法回答 10 无法回答次数',
  `keyword` text,
  `keyword_py` text,
  `action` tinyint(2) DEFAULT NULL COMMENT '0 等待用户响应 1 下一场景节点 2 指定场景节点 3返回当前场景节点中的话术 4挂机',
  `action_id` int(5) DEFAULT NULL,
  `intention` tinyint(2) DEFAULT NULL COMMENT '意向等级 默认为0不需要，大于0对应意向规则表level',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `pause_time` int(11) NOT NULL DEFAULT '3000' COMMENT '暂停时间，默认值3000，单位是毫秒',
  `label` varchar(255) DEFAULT NULL COMMENT '问答标签',
  `is_default` tinyint(1) DEFAULT '1' COMMENT '0 默认 不可删除',
  `sms_template_id` int(11) DEFAULT '0' COMMENT '短信模板id',
  `bridge` int(11) DEFAULT '0' COMMENT '座席组id',
  `sort` int(5) DEFAULT '10' COMMENT '排序',
  `break` tinyint(1) DEFAULT '1' COMMENT '是否打断 0打断  1不允许打断',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `scenarios_id_type` (`scenarios_id`,`type`) USING BTREE
